import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';
import About from './pages/aboutpage';
import Home from './pages/homepage';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' elsement={<Home />}></Route>
        <Route path='/about' elsement={<About />}></Route>
        <Route path='/contact' elsement={<Homepage />}></Route>
        <Route path='/seminars' elsement={<Homepage />}></Route>
        <Route path='/login' elsement={<Homepage />  }></Route>
        <Route path='/register' elsement={<Homepage />  }></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
